import React from 'react';
import classes from './List.module.scss';

type Item = {
    id: string;
    text: string;
}

interface ListProps {
    items: Item[]
}

const List: React.FC<ListProps> = (props) => {
    return (
        <div className={classes.List}>
            { props.children }
        </div>
    );
}

export default List;
